import React from "react";
import "./App.css";
import axios from "axios";

function App() {
  function test() {
    axios.get("http://localhost:3000/questions").then((res) => console.log(res));
  }

  let text = "aasW"

  const headers = {
    "Content-Type": "application/json",
  };

  var data = {
    question: "test2",
  };

  function handleClick(e) {
    e.preventDefault();
    axios
      .post("http://localhost:3000/questions", data, {
        headers: headers,
      })
      .then((res) => console.log(res))
      .catch(err => console.log(err));
  }

  function setQuestion(res){
    text = res.data.text
  }

  function handleQuestion(e){
    e.preventDefault();
    var pom = Math.floor(Math.random() * 3) + 1;
    axios
      .get("http://localhost:3000/questions/" + pom)
      .then((res) => setQuestion(res))
      .catch(err => console.log(err));
    console.log(text);
  }

  function getQuestion(){
      this.text
  }

  return (
    <div className="App">
      <header className="App-header">
        {test()}
        {getQuestion()}
        <a href="#" onClick={handleClick}>
          Kliknij mnie
        </a>
        <a href="#" onClick={handleQuestion}>
          Kliknij mnieee
        </a>
      </header>
    </div>
  );
}

export default App;
